  02> MACLEAN, Alan Haydon Awdrey m on 25.09.1943 to (1)WARNER, Margaret
  b 02.08.1917 d 06.07.1997
  b 26.02.1923
  Alan b. at Hunterville and m. at Finchley, London. Margaret, d/o Harold Leonard Warner and Lillian
  Emily Long, b. at Finchley, St Albans, England.
  Alan was educated at Wanganui Collegiate School then worked as a law clerk, a civil servant, a F/O in
  the RNZAF (1939-46), then in the State Advances offices at Masterton and Whangarei.
  01> MACLEAN, Wendy m on 09.02.1963 to GURDIT-SINGH, Parl
  b 24.09.1944
  b 19.12.1931
  Wendy b. at Fulmer Chase, Buckinghamshire, England. Parl, s/o Dula Gurdit-Singh and Eliza Florence
  Emily Smith, b, at Taupo. Address: 36 Bright Crescent, Napier.
  Wendy emigrated to New Zealand with her parents in 1946 and has worked as a dressmaker and sewing
  upholstery. Parl was a colour offset printer, has a signalman's ticket with the Railways, was a
  concrete technician and mix designer and coordinating stores foreman at the Whirinaki Pulp Mill.
  They are now partners in a cottage industry, Bay Bright Monograms
  01> GURDIT-SINGH, Chandra m on ** ** **** to MCLEOD, Warren Morrell
  Maria
  b 14.11.1963
  b 06.08.1958
  Chandra b. at Napier. Warren, slo Lancelot Hugh McLeod and Elizabeth Maureen Stevens, b, at
  Tapanui, Southland. Address: 65 Nuffield Avenue, Napier.
  Chandra was educated at Colenso High School and qualified as a NZ Registered Nurse via
  psychopaedic nursing. She was working in the paediatric ward at Hastings Public Hospital. They
  now own a butcher's shop in Taradale.
