  02> GURDIT-SINGH, Dahl
  b 25.11.1965
  Dahl b. at Napier. Address: 45 Cherry Way, Market Drayton, Shropshire TF9 IQw, England.
  Dahl was educated at Colenso High School, Napier and served an apprenticeship in horticulture
  with the Napier City Council. He worked as overseer on the Marine Parade floral clock and the
  Centennial Gardens for three years before going overseas. He now has a landscaping business in
  England.
  03> GURDIT-SINGH, Kharim
  b 12.05.1971
  Kharim b. at Napier. Address: Isobel Hale, IHC Home, Cnr Geddis Avenue and Riverbend Road,
